/*
-- #1, Export data from CNT_DEFAULT_PROFILE
SELECT 'INSERT INTO CNT_DEFAULT_PROFILE (
  ID, REVISION, ENTITY_VERSION, STATUS, DOC_STATUS, EDITING_STATUS, CREATE_USER, UPDATE_USER, CREATED_ON, UPDATED_ON,
  REF_ENTITY_NAME, 
  HUB_DOMAIN_ID, IS_FOR_REFERENCE, IS_LATEST, CREATE_USER_NAME, DOMAIN_ID)
 VALUES ('''
 || ID|| ''', 1, 1, NULL, ''active'', ''confirmed'', ''system'', NULL, SYSDATE, NULL, ''' ||
  REF_ENTITY_NAME || ''', '''
  || '/'', 0, 1, ''system'', ''/'');'
  FROM CNT_DEFAULT_PROFILE WHERE DOMAIN_ID = '/' AND CREATE_USER = 'system';
*/

/*

-- #2, Export data from CNT_DEFAULT_PROFILE_FIELD

SELECT 'INSERT INTO CNT_DEFAULT_PROFILE_FIELD ( ID, REVISION, ENTITY_VERSION, DOMAIN_ID, PROFILE_ID, MASTER_SEQ_NO, SEQ_NO, SECTION_ID, FIELD_ID, VALUE_TYPE
  , DEFAULT_VALUE, OVERRIDE_TEMPLATE, HUB_DOMAIN_ID, IS_FOR_REFERENCE, VALUE_TYPE_NAME) VALUES ('''
  || ID || ''', 1, 1, ''/'', ''' || CDPF.PROFILE_ID || ''', '  || MASTER_SEQ_NO || ', ' || SEQ_NO || ', ' || DECODE (SECTION_ID, '', 'NULL', '''' || SECTION_ID || '''')  || ', ''' || FIELD_ID || ''', '''
  || VALUE_TYPE || ''', ''' || DEFAULT_VALUE || ''', ' || DECODE (OVERRIDE_TEMPLATE, '', 'NULL', '''' || OVERRIDE_TEMPLATE || '''') || ', ''/'', 0, NULL);'
  FROM CNT_DEFAULT_PROFILE_FIELD CDPF WHERE DOMAIN_ID = '/' AND EXISTS (SELECT 1 FROM CNT_DEFAULT_PROFILE CDP WHERE DOMAIN_ID = '/' AND  CDP.ID = CDPF.PROFILE_ID) ORDER BY CDPF.PROFILE_ID;

-- #3, Export data from CNT_DEFAULT_PROFILE_TEMPLATE (0 record)

-- #4, Export data from CNT_CODELIST_LINK_INFO
SELECT 'INSERT INTO CNT_CODELIST_LINK_INFO(ID, REVISION, ENTITY_VERSION, DOMAIN_ID, REF_ID, REF_ENTITY, REF_FIELD, CODELIST_DOMAIN, 
  CODELIST_NAME, CODELIST_VERSION, CODELIST_CODE, CREATE_USER, CREATED_ON, HUB_DOMAIN_ID, IS_FOR_REFERENCE) VALUES ('''
  || ID || ''', 1, 1, ''/'', ''' || REF_ID || ''', ''' || REF_ENTITY || ''', ''' || REF_FIELD || ''', ''/'', '''
  || CODELIST_NAME ||  ''', 1, ''' || CODELIST_CODE || ''', ''system'', SYSDATE, ''/'', 0);' 
  FROM CNT_CODELIST_LINK_INFO CCLI
  WHERE DOMAIN_ID = '/' AND REF_ENTITY IN ('DefaultProfileField')
  AND EXISTS (SELECT 1 FROM CNT_DEFAULT_PROFILE_FIELD WHERE ID = CCLI.REF_ID) ;

*/
DELETE FROM CNT_CODELIST_LINK_INFO WHERE DOMAIN_ID = '/' AND REF_ENTITY IN ('DefaultProfileField', 'DefaultProfileTemplate');
DELETE FROM CNT_DEFAULT_PROFILE_TEMPLATE;
DELETE FROM CNT_DEFAULT_PROFILE_FIELD;
DELETE FROM CNT_DEFAULT_PROFILE;

